import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/optimizacion.css';
import OpcionRadio from './OpcionRadio';

class SeccionRadio extends React.Component{
    render(){
        return(
            <div className="seccionForm">
                <fieldset className="form-group">
                    <div className="row">
                        <legend className="col-form-label col-sm-2 pt-0">{this.props.nombre}</legend>
                        <div className="col-sm-10">
                            <div className="form-check">
                                <input className="form-check-input" type="radio" name="objetivo" value="maxganancias" defaultChecked = {false}></input> 
                                <label className="form-check-label">Maximizar ganancias</label>
                            </div>
                            <div className="form-check"></div>
                                <input className="form-check-input" type="radio" name="objetivo" value="mincostos" defaultChecked = {false}></input> 
                                <label className="form-check-label">Minimizar costos</label>
                            </div>
                            <div className="form-check"></div>
                                <input className="form-check-input" type="radio" name="objetivo" value="maxproduccion" defaultChecked = {false}></input> 
                                <label className="form-check-label">Maximizar produccion</label>
                            </div>
                        </fieldset>
                        </div>
        )
    }
}

export default SeccionRadio;
